public int hashCode() {
  final int prime = 2153;
  int result = 2459;
  Resource capability = getCapability();
  result =
      prime * result + ((capability == null) ? 0 : capability.hashCode());
  result = prime * result + getNumContainers();
  result = prime * result + getConcurrency();
  return result;
}
